// src/components/Navbar.js

import React from 'react';
import DarkModeToggle from './DarkModeToggle';

function Navbar() {
  return (
    <nav className="w-full bg-white dark:bg-gray-800 shadow-md mb-8">
      <div className="max-w-4xl mx-auto px-4 py-4 flex justify-between items-center">
        <h2 className="text-2xl font-bold text-primary dark:text-white">Don't Buy That</h2>
        {/* Future Links: About, Contact, etc. */}
        <div className="flex items-center space-x-4">
          <a href="#about" className="text-gray-700 dark:text-gray-300 hover:text-primary dark:hover:text-primary">About</a>
          <a href="#contact" className="text-gray-700 dark:text-gray-300 hover:text-primary dark:hover:text-primary">Contact</a>
          <DarkModeToggle />
        </div>
      </div>
    </nav>
  );
}

export default Navbar;
